import styled from "styled-components"
import Nav from "./Nav";
import Box from "../assets/box.jpeg"

const Wrapper = styled.div`
  img {
    width: 100%;
    max-height: 60%;
  }
  .content {
    position: absolute;
    top: 0;
    z-index: -1;
    height: 100%;
  }
  h1 {
    font-size: 70px;
    text-align: center;
    font-family: "Poppins", sans-serif;
  }
  p {
    width: 100%;
    display: flex;
    justify-content: center;
    padding: 1em 6em;
    font-size: 24px;
    font-family: "Poppins", sans-serif;
  }
`;

function About() {
    return (
      <Wrapper>
          <Nav style={{ position: "absolute", zIndex: 2 }} />
        <div className="content">
            <img src={Box} alt=""/>
            <div className="text">
                <h1>Why join Crossfit Attix?</h1>
